import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the view toggle buttons to appear
    await page.waitForSelector('.view-toggle', { timeout: 5000 });

    // Try to find the List View button by icon and class
    // The List View button has class 'view-btn' and a child <i> with class 'fa-list'
    const listViewBtn = await page.$('.view-toggle .view-btn:not(.active):has(i.fa-list)');
    if (!listViewBtn) {
      throw new Error('List View button not found');
    }

    // Click the List View button
    await listViewBtn.click();

    // Wait for the products-list container to appear (list mode)
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take screenshot after switching to list view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_list_view.png'));

    // Extract some data to verify list view is active
    // For example, count number of .product-card-list elements
    const listItemsCount = await page.$$eval('.products-list .product-card-list', els => els.length);

    return {
      success: true,
      action: "Switched to List View Mode using the List View toggle button",
      extractedData: {
        listItemsCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
